import './Login.css';

function App() {
  return (
    <div className="loginform">
      <div className="form">
        <form>
            <label className='name' type='text'  >Enter youe name :</label><br></br>
            <input className='iname' placeholder='NAME'></input>
            <label className='email ' type="email">Enter your email :</label><br></br>
            <input className='ieml' placeholder='EMAIL'></input>
            <label className='pass' type="password">Enter your password :</label><br></br>
            <input className='ipass' placeholder='PASSWORD'></input><br></br>
            <button className='subbt'>SUBMIT</button>
        </form>

      </div>
    </div>
  );
}

export default App;
